import React from 'react'
import {Button} from "reactstrap";

class FeaturesButton extends React.Component{
  render() {
    return(
      <Button
        className={
          this.props.featureSelectedNumber === this.props.number
            ? "features-btn-active"
            : "features-btn"
        }
        color="primary"
        onClick={this.props.toggleFeatureSelection1(this.props.number)}
      >
        {this.props.text}
      </Button>
    );
  }
}

export default FeaturesButton;
